    <>
      <Head>
        <title>MyStore</title>
        <link rel="stylesheet" href="https://rsms.me/inter/inter.css" />
        <meta name="Description" content="Put your description here."></meta>
      </Head>
      <CloudinaryContext cloudName="vercel">
        <Component {...pageProps} />
      </CloudinaryContext>
    </>
  );
}
